import React from 'react';

const ItemDetails = ({ item }) => {
  return (
    <div className="item-details">
      <h1>{item.dname}</h1>
      <p>{item.cost}</p>
      <p>{item.desc}</p>
    </div>
  );
};

export default ItemDetails;
